                      <Select                            
                        options={CountyOptions}  
                        value={{label: County}}                          
                        placeholder={'Choose county'}
                        name = 'County'           
                        onChange={(e) => { setCounty(e.value);}}
                      />

                    </div>

      <b className={styles.initiativesInThe}>Initiatives in the community</b>
